#endif
precision highp int;
uniform 	vec2 _GlobalMipBias;
uniform 	float _AlphaToMaskAvailable;
uniform 	vec4 _TimeParameters;
uniform 	vec4 _Color;
uniform lowp sampler2D _MainTex;
varying highp vec4 vs_INTERP0;
varying highp vec4 vs_INTERP1;
#define SV_Target0 gl_FragData[0]
vec4 u_xlat0;
lowp float u_xlat10_0;
bool u_xlatb0;
vec4 u_xlat1;
mediump float u_xlat16_2;
float u_xlat3;
bool u_xlatb3;
mediump float u_xlat16_5;
float u_xlat6;
lowp float u_xlat10_6;
mediump float u_xlat16_8;
float u_xlat9;
lowp float u_xlat10_9;
void main()
{
    u_xlat10_0 = texture2D(_MainTex, vs_INTERP0.xy, _GlobalMipBias.x).y;
    u_xlat3 = u_xlat10_0 + u_xlat10_0;
    u_xlat3 = clamp(u_xlat3, 0.0, 1.0);
    u_xlat6 = u_xlat3 * -2.0 + 3.0;
    u_xlat3 = u_xlat3 * u_xlat3;
    u_xlat3 = u_xlat3 * u_xlat6;
    u_xlat1.xw = _TimeParameters.xx * vec2(2.0, -2.0);
    u_xlat1.y = float(0.0);
    u_xlat1.z = float(0.0);
    u_xlat1 = vs_INTERP0.xyxy * vec4(3.0, 1.0, 3.0, 1.0) + u_xlat1;
    u_xlat10_6 = texture2D(_MainTex, u_xlat1.zw, _GlobalMipBias.x).z;
    u_xlat10_9 = texture2D(_MainTex, u_xlat1.xy, _GlobalMipBias.x).x;
    u_xlat9 = u_xlat10_9 * 0.5;
    u_xlat3 = u_xlat3 * u_xlat10_6;
    u_xlat3 = max(u_xlat3, u_xlat9);
    u_xlat0.x = u_xlat10_0 + u_xlat3;
    u_xlat3 = max(u_xlat0.x, u_xlat9);
    u_xlat0.xzw = u_xlat0.xxx * _Color.xyz;
    SV_Target0.xyz = u_xlat0.xzw;
    u_xlat16_2 = u_xlat3 * vs_INTERP1.w + -0.00999999978;
    u_xlat0.x = u_xlat3 * vs_INTERP1.w;
    u_xlat16_5 = dFdx(u_xlat0.x);
    u_xlat16_8 = dFdy(u_xlat0.x);
    u_xlat16_5 = abs(u_xlat16_8) + abs(u_xlat16_5);
    u_xlat16_8 = (-u_xlat16_5) * 0.5 + u_xlat16_2;
    u_xlat16_5 = max(u_xlat16_5, 9.99999975e-05);
    u_xlat16_5 = u_xlat16_8 / u_xlat16_5;
    u_xlat16_5 = u_xlat16_5 + 1.0;
    u_xlat16_5 = clamp(u_xlat16_5, 0.0, 1.0);
    u_xlat16_8 = u_xlat16_5 + -9.99999975e-05;
    u_xlatb3 = _AlphaToMaskAvailable!=0.0;
    u_xlat16_2 = (u_xlatb3) ? u_xlat16_8 : u_xlat16_2;
    SV_Target0.w = (u_xlatb3) ? u_xlat16_5 : u_xlat0.x;
    u_xlatb0 = u_xlat16_2<0.0;
    if(u_xlatb0){discard;}
    return;
}


